import React from 'react'
import { Box, Button, AppBar, Toolbar, Avatar, Typography, useTheme, Link } from "@mui/material"

const navItems = ['About', 'Work Experience', 'Projects', 'Contact']

export const NavBar = () => {
    const theme = useTheme()
    const contact = document.getElementById('contact')
    const education = document.getElementById('education')

    interface NavButtonProps {
        onClick: () => void
        text: string
    }

    const NavButton = ({ onClick, text }: NavButtonProps) => {
        return (
            <Button
                onClick={onClick}
                sx={{
                    textTransform: 'none',
                    color: theme.custom.black
                }}
            >
                {text}
            </Button>
        )
    }

    return (
        <Box>
            <AppBar
                position="static"
                sx={{
                    backgroundColor: theme.palette.background.default,
                    px: 4
                }}
                elevation={0}
            >
                <Toolbar
                    sx={{ justifyContent: 'space-between' }}
                >
                    <Box
                        display={'flex'}
                        sx={{
                            alignItems: 'center'
                        }}
                        gap={1}
                    >
                        <Avatar alt="William Ho" src={`${process.env.PUBLIC_URL}/selfimage.jpg`} />
                        <Typography>WILLIAM HO</Typography>
                    </Box>
                    <Box
                        display={'flex'}
                        gap={3}
                    >
                        <Typography>About</Typography>
                        <Typography>Professional experience</Typography>
                        <Typography>Projects</Typography>
                        <Typography onClick={() => console.log('hi')}>Education</Typography>
                        <NavButton
                        onClick={() => {
                            if (education) {
                                education.scrollIntoView()
                            }
                        }}
                        text={'Education'}
                        />
                        <Button
                            onClick={() => {
                                if (contact) {
                                    console.log('here')
                                    contact.scrollIntoView({
                                        behavior: 'smooth',
                                        block: 'start'
                                    })
                                }
                            }}
                            sx={{
                                textTransform: 'none',
                                color: theme.custom.black
                            }}
                        >
                            Contact
                        </Button>
                    </Box>
                </Toolbar>
            </AppBar>
        </Box>
    )
}
